import React from "react";
import { Link } from "react-router-dom";
import intLOGO from "../../assets/images/interactlogo.SVG";

const LoginNav = () => {
  return (
    <header className="py-6 mb-12 border-b">
      <div className="container mx-auto flex justify-between items-center">
        {/* logo */}
        <Link to="/" className="flex items-center">
          {" "}
          {/* Added flex class */}
          <img src={intLOGO} alt="" />
        </Link>
        {/* Buttons */}
        <div className="flex items-center gap-6">
          <Link
            className="font-[800] text-greenColor hover:animate-pulse border-b-[2px] border-greenColor hover:border-greenColor transition"
            to="/"
          >
            Log in
          </Link>
          <Link
            className="font-[800] text-greenColor py-1 px-1 hover:animate-pulse transition"
            to="/register"
          >
            Register
          </Link>
        </div>
      </div>
    </header>
  );
};

export default LoginNav;
